import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PersonPinIcon from '@material-ui/icons/PersonPin';
import Person from '@material-ui/icons/Person';
import Typography from '@material-ui/core/Typography';

import Paper from '@material-ui/core/Paper';
import Fab from '@material-ui/core/Fab';
import HomeIcon from '@material-ui/icons/Home';
import Osman from "./diensten/osman/osman.jsx";

import Monthbar from "./diensten/osman/monthbar.jsx"

function TabContainer(props) {
  return (
    <Typography component="div" style={{ padding: 5 * 3 }}>
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired,
};

const styles = theme => ({
  root: {
    flexGrow: 1,
    maxWidth: '100%',
    maxHeight: '100%',
    /*paddingTop: '70px',*/
    top: 5,
    position: 'sticky',
    paddinTop: '-168px',
  },
  fabButton: {
    position: 'fixed',
    bottom: theme.spacing.unit * 2,
    right: theme.spacing.unit * 2,
  },
});

class IconLabelTabs extends React.Component {
  state = {
    value: 0,
  };

  handleChange = (event, value) => {
    this.setState({ value });
  };

  render() {
    const { classes } = this.props;
    const { value } = this.state;

    return (
      <div /*style={{ margin: 5 * 3 }}*/>
      <Paper style={{ margin: 5 * 3 }} className={classes.root}>
        
        <Tabs
          value={this.state.value}
          onChange={this.handleChange}
          variant="fullWidth"
          indicatorColor="primary"
          textColor="primary"
        >
          <Tab icon={<Person />} label="OSMAN" />
          <Tab icon={<PersonPinIcon />} label="REMCO" />
          <Tab icon={<PersonPinIcon />} label="CENGIZ" />
          <Tab icon={<PersonPinIcon />} label="KUBILAY" />
        </Tabs>
      
        <Monthbar />
      </Paper>
      {value === 0 && <TabContainer><Osman /></TabContainer>}
      {value === 1 && <TabContainer><Osman /></TabContainer>}
      {value === 2 && <TabContainer><Osman /></TabContainer>}
      {value === 3 && <TabContainer><Osman /></TabContainer>}

      <Fab color="primary" aria-label="Home" className={classes.fabButton}>
            <HomeIcon />
          </Fab>
      </div>
    );
  }
}

IconLabelTabs.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(IconLabelTabs);
